import React from "react";

export default class Block extends React.Component {
  constructor() {
    super();
    this.state = {
      active: false,
      // Color list for coloring param2
      colors: [
        "#CC5151",
        "#51CCCC",
        "#8ECC51",
        "#8E51CC",
        "#CCAD51",
        "#51CC70",
        "#5170CC",
        "#CC51AD",
        "#CC7F51",
        "#BCCC51",
        "#60CC51",
        "#51CC9E",
        "#519ECC",
        "#6051CC",
        "#BC51CC",
        "#9E1452",
        "#CFA2B0",
        "#CC9651",
        "#4BEC4E",
        "#E8FA14",
        "#1170DD",
        "#E8B080",
        "#694C33",
        "#D8A0CD",
        "#803D73",
        "DA8E95",
        "#831E27",
        "#A7B6BC",
        "#143E4D",
        "#9CF69C",
        "#267826",
        "#D3E19B",
        "#646D40",
        "#757575"
      ]
    };
  }

  toggle = () => {
    this.setState(function(state, props) {
      return {
        active: !this.state.active
      };
    });
  };
  // AgtId

  // colourData -> array for the colours

  //
  render() {
    var color = this.state.colors[0];
    return <rect x="10" y="10" height="100" width="100" fill={color} />;
  }
}

